import React, {useState, useEffect} from 'react';
import {IoPeopleOutline} from 'react-icons/io5';

function ListChannels() {
    const [channels, setChannels] = useState([]);

    async function fetchJodels() {
        const response = await fetch('http://localhost:8080/channels');
        const json = await response.json();
        setChannels(json);
    }

    useEffect(() => {fetchJodels()}, []);
    //console.log(channels);

    const styles = {
        channel: {
            border: '1px solid #bbbdbf',
            width: 430,
            height: 50,
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            padding: 10
        },
        container: {
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            flexDirection: 'column',
            backgroundColor: '#e6e7e8',
        }  
    }


    return(
        <div style={styles.container}>
            {
                channels.map((chan) => (
                    <div key={chan.channelId}>
                        <h2 style={styles.channel}>{chan.channelName}<IoPeopleOutline style={{marginLeft: 100}}/></h2>
                    </div>
                ))
            }
        </div>
    )
}

export default ListChannels;
